import React from 'react'
import styled from 'styled-components';

const paragraph = styled.p`
  color: #676767;
  font-size: 12px;
  font-weight: medium;
`;

const p = () => {
         return <paragraph href="">Een paragraaf</paragraph>
}

export default p;
